import React from "react";
import {addToCart} from "../Carrito"

export const ObjectProducto = (
    { id,
        name,
        picture,
        price,
        stock,
        id_category
    }) => {
    return (
        <div>
            <h1>{name}</h1>
            
            {picture}
            {price}
            {stock}
            <button onClick={()=> addToCart(id)}>
                Agregar
            </button>
        </div>
        
    )
}
